        <div className="footer__icons">
          <div className="footer__icon">
            <div className="footer__title">Студия</div>
            <Studio />
          </div>
          <div className="footer__icon">
            <Services />
          </div>
          <div className="footer__icon"></div>
        </div>
        <div className="footer__social">
          <img src={inst} alt="" />
